import React, { useState } from 'react';
import Pdfs from './Pdfs';

const ExpandableList = ({ title, content }) => {
  const [isActive, setIsActive] = useState(false);

  return (
    <div className="accordion-item" style={{fontFamily:'Poppins'},{alignSelf:'center'}}>
      <div className="accordion-title" style={{color:'white',backgroundColor:'black'}} onClick={() => setIsActive(!isActive)}>
        <div>{title}</div>
        <div>{isActive ? '-' : '+'}</div>
      </div>
      {isActive && <div className="accordion-content">{<Pdfs list_pdfs={content}/>}</div>}
    </div>
  );
};

export default ExpandableList;
